import React from 'react';
import './Service.css'

const Service = (props) => {
    const { title, body, image, price } = props.service;
    return (
        <div className="service m-4">
            <img src={image} alt="" />
            <h3>{title}</h3>
            <p>{price}</p>
            <p className="px-3">{body}</p>

        </div>
    );
};

export default Service;
